column8:
ラジエーターに注入するだけで水漏れ箇所を簡単に補修！<br>
事前に入れておけば水漏れ発生直後、即座に漏れを止めます。<br>
永久補修型なので、再度冷却水を交換しても漏れません。<br>
ラジエター容積3～10Lに対し本品1本を使用。<br>
